import React, { useContext} from "react";
import { RowNewsletter } from "./RowNewsletter";
import { Modal } from "../commons/Modal";
import { NewsletterContext } from '../../contexts/NewsletterContext';

export const TableNeswsletter = () => {

   const { neswsletterList } = useContext ( NewsletterContext );
   console.log(neswsletterList.length);
   if (neswsletterList.length === 0 ) return <center> <p>No existen clientes</p></center>
  return (
    <>
      <table className="table table-striped">
        <thead>
          <tr>
            <th>Actions</th>
            <th>Name</th>
            <th>Attach</th>
            <th>Creation Date</th>
            <th>Sent Date</th>
            <th>Estatus</th>
          </tr>
        </thead>
        <tbody>
            {
                neswsletterList.map( neswsletter => (
                        <RowNewsletter neswsletter = { neswsletter } key={neswsletter.newsletterId}/>
                    ))
            }        
        </tbody>
      </table>
      <Modal title="Newsletter List- Email configuration" id="mailConfig" />
    </>
  );
};
